import React from "react";
import { v4 } from "uuid";

function Obligation({ obligationName, parameters, id }) {
  return (
    <li key={id} className="card w-96 bg-base-100 shadow-xl">
      <div className="card w-96 bg-base-100 shadow-xl">
        <div className="card-body">
          <h1 className="card-tittle font-bold text-left mt-2">
            Obligation name: {obligationName}
          </h1>
          <ul>
            {parameters.map((parameterName) => {
              return (
                <li
                  className=" text-xs text-cyan-200 text-left mx-4"
                  key={v4()}
                >
                  <h1>Parameter name {parameterName}</h1>
                  <input type="..." />
                </li>
              );
            })}
          </ul>
        </div>
      </div>
    </li>
  );
}

export default Obligation;
